DeepBoreMine:
; Deep Bore Mine only extracts an ore in certain circumstances.
; It mines on every 16th tick, or every 8th tick with 2nd Generation blueprint.
; A certain condition must be 7 or lower for this to operate.
; If a certain flag is not set, it operates at 40% efficiency.
; Ore is chosen randomly; if the chosen type is unavailable the next ore is
; chosen instead, e.g. if there is only Selenium and Crystalite, a Mine will
; dig Crystalite with a 3:1 ratio. "Next" here is cyclical.
; If no storage space is available, the ore is not mined. You cannot waste
; asteroid ore by building mines without Storage Towers, although
; Asteros depletes as if by natural radioactiev decay, due to a bug in Powerplant.
